import React from 'react';
import styled from 'styled-components';


const Container = styled.div`
    display: flex;
`;

// Designing the left side of the container.. 
const Left = styled.div`
    flex: 1;
`;

const Logo = styled.div``;

const Desc = styled.div``;

const Facebook = styled.div``;

const Instagram = styled.div``;

const LinkedIn = styled.div``;

const Reddit = styled.div``;

const Center = styled.div`
    flex: 1;
`;

const Right = styled.div`
    flex: 1;
`;


export default function Footer() {
  return (

    <Container>
    {/* Designing the left side of the Footer.. */}
        <Left>
            <Logo>CATE.</Logo>
            <Desc>Mollit eu laboris occaecat amet aliquip sunt. Duis do laboris est culpa irure. Velit est do consequat nostrud duis pariatur.</Desc>
            <SocialContainer>
                <Facebook>Facebook</Facebook>
                <Instagram>Instagram</Instagram>
                <LinkedIn>LinkedIn</LinkedIn>
                <Reddit>Reddit</Reddit>
            </SocialContainer>
        </Left>

        <Center></Center>

        <Right></Right>
    </Container>

  )
}
